const express = require('express');

const app = express();

app.set('view engine', 'ejs');

app.get('/', (req, res) => {
  res.render('landing');
});

app.get('/campgrounds', (req, res) => {
  const campgrounds = [
    { name: 'Lori', image: 'data:image/jpeg;base64,' },
    { name: 'Gala', image: 'data:image/jpeg;base64,' },
    { name: 'Ashito', image: 'data:image/jpeg;base64,' },
  ];

  res.render('campgrounds', { campgrounds });
});

app.listen(3000, () => {
  console.log('The YelpCamp Server Has Started!');
});
